import React, { useEffect, useState } from "react";

const TestZillowApi = () => {
  const [data, setData] = useState([]); // Initialize as an empty array
  const [loading, setLoading] = useState(true);

  const fetchZillowData = async () => {
    const url =
      "https://zillow56.p.rapidapi.com/search?location=houston%2C%20tx";
    const options = {
      method: "GET",
      headers: {
        "X-RapidAPI-Key": "ce424b08dfmsh723f4c57800adb0p134ee8jsn0fa8554b8f0f",
        "X-RapidAPI-Host": "zillow56.p.rapidapi.com",
      },
    };

    try {
      const response = await fetch(url, options);
      const result = await response.json(); // Parse JSON response
      setData(result.results);
      setLoading(false);
    } catch (error) {
      console.error("Error fetching data:", error);
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchZillowData();
  }, []);

  return (
    <div>
      {loading ? (
        <p>Loading...</p>
      ) : data.length > 0 ? (
        data.map((item) => (
          <div key={item.zpid} className="property-card">
            <img src={item.imgSrc} alt="Property" className="property-image" />
            <div className="property-details">
              <p>
                Address: {item.streetAddress}
              </p>
              <p>
                City: {item.city}, {item.state} {item.zipcode}
              </p>
              {/* <p>Bedrooms: {item.bedrooms}</p>
              <p>Bathrooms: {item.bathrooms}</p>
              <p>Price: ${item.price.toLocaleString()}</p>
              <p>Home Type: {item.homeType}</p>
              <p>Home Status: {item.homeStatus}</p> */}
            </div>
          </div>
        ))
      ) : (
        <p>No data available.</p>
      )}
    </div>
  );
};

export default TestZillowApi;
